エンジンプラグは消耗品です。劣化した状態ではエンジンは本来のパワーを発揮できず、燃費も悪化し良いことはありません。定期的にリフレッシュしエンジンを好調な状態をキープ！ <br><br>中心電極は、多量の熱を素早く逃がすよう、先端近くまで銅を封入した「銅芯入り」構造となっています。 これにより、焼けにも、くすぶりにも強い超「ワイドレンジ」プラグを実現しています。 <br><br>プラグ品番：BPR4EVX  本数：8本 <br><br>対応車種：88/9～ ロールスロイス コーニッシュ  (型式：E-RD  排気量：6700cc) <br><br>車検対応品<br><br>点火系/プラグ<tr><td colspan="2">
